import React from 'react';

const SimpleComponent = ({ onLogin, onLogOut, isAuth }) => {
  console.log('SimpleComponent', isAuth);
  return (
    <>
      {!isAuth ?  <button onClick={onLogin}>Login</button> : <button onClick={onLogOut}>Logout</button>}
    </>
  );
}

export default SimpleComponent;
